import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";


export default function People() {
  const [trendingPerson, setTrendingPerson] = useState([]);

  let getTrendingPerson = async () => {
    let { data } = await axios.get(
      "https://api.themoviedb.org/3/trending/person/day?api_key=df0aad8d17f69e36bdd1a3de0d77194f"
    );
    setTrendingPerson(data.results);
    console.log(data.results);
  };

  useEffect(() => {
    getTrendingPerson();
  }, []);

  return (
    <>
      <div className="row py-4 gy-3">
        <div className="col-md-4">
          <div className="bordr w-25 mb-3"> </div>
          <h3>Trending</h3>
          <h3>People</h3>
          <h3>To watch Now</h3>
          <p className="text-muted mb-3">most watched People by day</p>
          <div className="bordr "></div>
        </div>
        {trendingPerson.slice(0, 10).map((item, index) => (
          <div className="col-md-2" key={index}>
            <div className="item position-relative">
              <img
                className="w-100"
                src={`https://image.tmdb.org/t/p/w500` + item.profile_path}
                alt=""
              />
              <h2 className="h6">
                {item.name}
                {item.title}
              </h2>
              <span className="position-absolute top-0 end-0 p-2 bg-info">
                {item.vote_average}
              </span>
            </div>
          </div>
        ))}
      </div>
    </>
  );
}
